import React, { useState } from "react";
import "./CardsTinder.css";

function CardsTinder() {
  const [persona, setPersona] = useState([
    {
      nombre: "Laura Albarracín",
      url:
        "https://www.google.com/search?q=fotos+de+perfil+laura+albarracin&sxsrf=ALeKk01nI_9azAmWwJTmj-q6beaDEZIzRw:1617374187491&tbm=isch&source=iu&ictx=1&fir=W6bxVVXM5mcYWM%252CNoQkmxpVT1hGEM%252C_&vet=1&usg=AI4_-kTCUQw9755WGMQbEQGkicC4FnS6JA&sa=X&ved=2ahUKEwjV7Kev5N_vAhXdK7kGHYNfDf4Q9QF6BAgMEAE#imgrc=W6bxVVXM5mcYWM",
    },
    {
      nombre: "Victor Inojosa",
      url:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTaXc32XbJQLXH0GgzUeGT4cwVHjSoGulpGbRL_TKzRB6hemm5I9w0atW577q1J5GGV&usqp=CAU",
    },
    {
      nombre: "Brad Pitt",
      url:
        "https://www.google.com/search?q=fotos+de+perfil+Brad+pi&sxsrf=ALeKk00qLLBoJLwRT7xXXQ6oOnx5Avik4g:1617374330739&tbm=isch&source=iu&ictx=1&fir=GfidosIeU1YUEM%252CL1MKQNMqGiHtGM%252C_&vet=1&usg=AI4_-kQzEAKLDHS-Cqk9H7qZlPXTA_ERFg&sa=X&ved=2ahUKEwiB-87z5N_vAhW3ILkGHdfcAyAQ9QF6BAgNEAE#imgrc=GfidosIeU1YUEM",
    },
  ]);

  return (
    <div className="cardsTinder">
      <div className="cardsTinder__contenedor"></div>
      {persona.map((persona) => (
        <h1>{persona.nombre}</h1>
      ))}
    </div>
  );
}

export default CardsTinder;
